import {FETCH_TOP_PLAYERS,FETCH_LATEST_PLAYERS} from './actionType'
import axios from 'axios'

export const fetchTopPlayer = () => dispatch => {
    axios.get('http://localhost:8080/api/public/v1/players/top')
        .then(res =>
            dispatch({
                type: FETCH_TOP_PLAYERS,
                payload: res.data
            })
        );
};
export const fetchLatestPlayers = () => dispatch => {
    axios.get('http://localhost:3001/api/public/v1/players/latest')
        .then(res =>
            dispatch({
                type: FETCH_LATEST_PLAYERS,
                payload: res.data
            })
        );
};
